import React from 'react';
import './App.css';
import { Switch, Route, Link } from 'react-router-dom';
import ViewDicas from './Dicas';
import ViewHome from './Home';

import { Footers } from './styles';



function App (props) {
  return (
    <div>
      <header className="container-fluid p-0">
      <nav className="navbar navbar-expand-md navbar-dark bg-dark">

        <Link className="navbar-brand" to="/page1"><i className="fas fa-hospital-user"></i>&nbsp;Saúde e Mapeamento</Link>

       <setion className="collapse navbar-collapse" id="navbarMainToggler">
          <div className="navbar-nav ml-auto">
            <Link className="nav-item nav-link" to="page1">Inicio</Link>
            <Link className="nav-item nav-link" to="page2">Dicas</Link>
            <a className="nav-item nav-link" href="#">Feedback</a>
          </div>
        </setion>

       <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarMainToggler"
       aria-controls="navbarMainToggler" aria-expanded="false" aria-label="Toggle navigation"> 
         <span className="navbar-toggler-icon"></span>
       </button>
        </nav>
        </header>

        <main>
        <Switch>
        <Route path="/page1" component={ViewHome}/>
          <Route path="/page2" component={ViewDicas}/>
        </Switch>
        </main>



        <Footers className="bg-dark">

            <p>©2020 Todos os direitos reservados.</p>

        </Footers>
      </div>

    
     


    // <div>
    //         {/* <Headers /> */}
    //         {/* <Article />
    //         <Footer /> */}
    //       </div>
    
  );
};


export default App;
